import React from 'react';
import './AdminPage.css';

const AdminPage = () => {

  const navigate = useNavigate();

    const listUsers = () => {
        console.log('Logging out...');
        fetch('http://0.0.0.0:8888/auth/logout/', {
            method: 'POST',
            credentials: 'include'
        })
        .then(response => {
            console.log('Logout response:', response);
            if (response.ok) {
                // Handle successful logout
                navigate('/home/mints/Downloads/staff_management_system/src/pages/Login.jsx'); // Redirect to login page
            } else {
                // Handle error
                console.error('Logout failed');
            }
        })
        .catch(error => {
            console.error('Logout error:', error);
        });
    };







  return (

    <div>
      <div className="sidebar">
        <ul>
          <li onClick={listUsers}>Menu Item 1</li>
          <li>Menu Item 2</li>
          <li>Menu Item 3</li>
          {/* Add more menu items as needed */}
        </ul>
      </div>
      <div>
        <h2>Admin Panel</h2>
        <p>Welcome to the Admin Panel. You have access to administrative features.</p>
      </div>


    </div>
  );
};

export default AdminPage;
